2022 = 2+2+2 = 6

Jogador que iria marcar o gol da vitória estava com a camisa 18:
- 18 = 6 + 6 + 6 ;
- Um hexacampeão ( Brasil) = 6 vezes campeão;
- Mês 12 = 6 + 6 ;
- O total de letras nos nomes "Brasil" e "França" dão 6 ( em inglês, também);
-O placar do jogo está 3 x 3 ( = 6);
- O jogo da final será no horário de 12:00 BRT, o qual, convertido para o fuso horário do local físico no jogo ( +6) será às 18:00 horas. 

E aparece um jogador brasileiro com a camisa 7 escrito "paz" 

Conectem as pontas e é fácil perceber que uma grande mensagem está sendo passada utilizando por meio de um campeonato a nível mundial.
